import React, { Component } from "react";

export default class Grid extends Component {
  render() {
    const styles = {
      border: "2px solid darkblue"
    };

    return (
      <div class="container">
        <div class="row">
          <div class="col-sm">1.</div>
          <div class="col-sm">2.</div>
          <div class="col-sm">3.</div>
          <div class="col-sm">4.</div>
        </div>
      </div>
    );
  }
}
